#[derive(Debug)]
pub struct Certificate<'a> {
    raw: &'a [u8],
    tbs_raw: &'a [u8],
    tbs_certificate: Asn1TbsCertificate<'a>,
    signature_algorithm: AlgorithmIdentifier,
    signature: asn1::BitString<'a>,
    // version       :i32,

    // serial_number   :asn1::BigInt<'a>,

    // signature_algorithm: AlgorithmIdentifier,

    // issuer:             RawObject,

    // Validity  :         validity,
    // Subject            asn1.RawValue
    // PublicKey          publicKeyInfo
    // UniqueId           asn1.BitString   `asn1:"optional,tag:1"`
    // SubjectUniqueId    asn1.BitString   `asn1:"optional,tag:2"`
    // Extensions         []pkix.Extension `asn1:"optional,explicit,tag:3"`
}

impl<'a> Certificate<'a> {
    fn from_der(data: &'a [u8]) -> asn1::ParseResult<Self> {
        let cert: asn1::Tlv<'a> = asn1::parse_single(data)?;
        let (tbs, signature_algorithm, signature) = asn1::parse(cert.data(), |p| {
            let tbs: asn1::Tlv<'a> = p.read_element()?;
            let signature_algorithm: AlgorithmIdentifier = p.read_element()?;
            let signature: asn1::BitString<'a> = p.read_element()?;
            Ok((tbs, signature_algorithm, signature))
        })?;
        let tbs_raw = tbs.full_data();
        let tbs_certificate = asn1::parse(tbs_raw, |p| p.read_element::<Asn1TbsCertificate>())?;
        Ok(Certificate {
            raw: data,
            tbs_raw: tbs_raw,
            tbs_certificate: tbs_certificate,
            signature_algorithm: signature_algorithm,
            signature: signature,
        })
    }

    fn verify(&self) -> bool {
        if self.tbs_certificate.issuer != self.tbs_certificate.subject{
            return true;
        }
        if *self.signature_algorithm.parameters.item() == OidSignatureSM2WithSM3 {
            let public_key = self.tbs_certificate.subject_public_key_info.public_key.as_bytes();
            // TODO: parse sm2 key.
            if public_key.len() != 65 {
                return false;
            }
            let x = U256::from_be_slice(&public_key[1..33]).unwrap();
            let y = U256::from_be_slice(&public_key[33..65]).unwrap();
            let public_key = sm2::PublicKey { x: x, y: y };
            let signature = self.signature.as_bytes();
            let signature = sm2::Signature::unmarshal_asn1(signature);
            if signature.is_err() {
                panic!("parse signature failed: {}", signature.err().unwrap())
            }
            let signature = signature.unwrap();
            let e = sm2::precompute_with_id_public_key_msg(None, &public_key, &self.tbs_raw);
            sm2::verify(&e, &public_key, &signature)
        }else{
            println!("not sm2key");
            return true;
        }
    }
}

/// The ASN.1 format representation of a certificate.
#[derive(asn1::Asn1Read, asn1::Asn1Write, Debug, PartialEq, Eq)]
pub struct Asn1Certificate<'a> {
    // raw: &'a [u8],
    tbs_certificate: Asn1TbsCertificate<'a>,
    signature_algorithm: AlgorithmIdentifier,
    signature: asn1::BitString<'a>,
}

#[derive(asn1::Asn1Read, asn1::Asn1Write, Debug, PartialEq, Eq)]
pub struct Asn1TbsCertificate<'a> {
    // We will always use x509v3.
    // EXPLICIT Version DEFAULT v1 {v1(0), v2(1), v3(2)}
    #[default(0)]
    #[explicit(0)]
    pub version: i32,

    pub serial_number: asn1::BigInt<'a>,

    pub signature_algorithm: AlgorithmIdentifier,

    pub issuer: Name<'a>,

    pub validity: Validity,

    pub subject: Name<'a>,

    pub subject_public_key_info: PublicKeyInfo<'a>,

    #[implicit(1)]
    pub unique_id: Option<asn1::BitString<'a>>,

    #[implicit(2)]
    pub subject_unique_id: Option<asn1::BitString<'a>>,

    #[explicit(3)]
    pub extensions: Option<Extensions<'a>>,
}

#[derive(asn1::Asn1Read, asn1::Asn1Write, Debug, PartialEq, Eq)]
enum Time {
    UtcTime(asn1::UtcTime),
    GeneralizedTime(asn1::GeneralizedTime),
}

#[derive(asn1::Asn1Read, asn1::Asn1Write, Debug, PartialEq, Eq)]
pub struct Validity {
    not_before: Time,
    not_after: Time,
}

#[derive(asn1::Asn1Read, asn1::Asn1Write, Debug, PartialEq, Eq)]
pub struct PublicKeyInfo<'a> {
    algorithm: AlgorithmIdentifier,
    public_key: asn1::BitString<'a>,
}

